  name: "winch-sign-svg",
  props: ["side", "clickedOnBtnSign", "learnedBtnsArr"],
  data() {
    return {};
  },
  methods: {
    showPopOut(winchTo) {
      if (!this.clickedOnBtnSign) {
        let titleToPopOut = this.theTitle + " ";
        if (winchTo === "wire") {
          titleToPopOut += "לכבל";
        } else {
          titleToPopOut += "לשרשרת";
        }
        this.$emit("show-pop-out", titleToPopOut);
      }
    },
  },
  computed: {
    theTitle() {
      if (this.side === "right") {
        return "כננת מכאנית";
      } else {
        return "כננת חשמלית";
      }
    },
  },
};
